values:
meet LC.&nbsp;

LC is celebrating her 23rd birthday today. She was celebrating it at Heat with family and friends. it is a small dinner but a lively one. She had a poster of herself plastered on the wall with the words "Happy Birthday LC" on it. she also had one of those sign things by the entrance, so people can sign up.&nbsp;

LC is a medical student, who studies in a school with a green logo attached to the medical lab gowns.&nbsp;I think she even has her own car. 

LC has a dog. it is a pug. like what blabidy-blah gave to blahbidy-bleh. just so you know, i don't like pugs. we have 2 of them at home.&nbsp;

Have I met LC?
Is LC my friend?
Do I know what LC stands for?

NO.

but all the same. i want to greet LC happy birthday. because i&nbsp;would have to pass by her celebration in order&nbsp;to get food. and leave the place.

with that said, happy birthday LC. &nbsp;

yah. it's nishikido ryo's birthday today. hahaha :)

i posted a preview of yukan club..i got it from youtube. just look at &lt;lj user="animorocker"&gt; 

yes, i have a new lj to post all those things. :)
